import { BrowserRouter, Route, Routes } from "react-router-dom";
import Home from "./Website/Pages/Home";
import About from "./Website/Pages/About";
import Service from "./Website/Pages/Service";
import Feature from "./Website/Pages/Feature";
import Team from "./Website/Pages/Team";
import Appointment from "./Website/Pages/Appointment";
import Testimonials from "./Website/Pages/Testimonials";
import Contact from "./Website/Pages/Contact";
import PNP from "./Website/Pages/PNP";
import Dashboard from "./Admin/Pages/Dashboard";
function App() {
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route
            path="/"
            element={
              <>
                <Home />
              </>
            }
          ></Route>
          <Route
            path="/about"
            element={
              <>
                <About />
              </>
            }
          ></Route>
          <Route
            path="/services"
            element={
              <>
                <Service />
              </>
            }
          ></Route>
          <Route
            path="/feature"
            element={
              <>
                <Feature />
              </>
            }
          ></Route>
          <Route
            path="/ourdoctor"
            element={
              <>
                <Team />
              </>
            }
          ></Route>
          <Route
            path="/appointment"
            element={
              <>
                <Appointment />
              </>
            }
          ></Route>
          <Route
            path="/testimonials"
            element={
              <>
                <Testimonials />
              </>
            }
          ></Route>
          <Route
            path="contact"
            element={
              <>
                <Contact />
              </>
            }
          ></Route>
          <Route
            path="*"
            element={
              <>
                <PNP />
              </>
            }
          ></Route>

          {
            // admin Routes
          }
          <Route
            path="/dashboard"
            element={
              <>
                <Dashboard />
              </>
            }
          ></Route>
          <Route
            path="/Admin_Login"
            element={
              <>
                <Contact />
              </>
            }
          ></Route>
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
